import React from "react";
import PropTypes from "prop-types";

const Card = (props) => {
  return (
    <div className="CardWrapper">
      <div className="ColDetail">
        <div className="Header">
          <div className="BookTitle">{props.login}</div>
        </div>
      </div>
    </div>
  );
};

Card.propTypes = {
  /**
   *  Name
   */
  name: PropTypes.string.isRequired,
};

export default Card;
